  MDBDropdownMenu,
  MDBDropdownItem,
  MDBContainer,
  MDBIcon
} from "mdbreact";

import { useSelector, useDispatch } from "react-redux";

import TopNavBar from "../TopNavigationBar";

const Dashboard = props => {
  return (
    <MDBContainer>
      <TopNavBar />
    </MDBContainer>
  );
};
export default Dashboard;
